package main

import (
	"context"
	"fmt"
	"testing"

	"github.com/tencentcloud/tencentcloud-sdk-go/tencentcloud/common"
	"github.com/tencentcloud/tencentcloud-sdk-go/tencentcloud/common/profile"
	sts "github.com/tencentcloud/tencentcloud-sdk-go/tencentcloud/sts/v20180813"
)

func Test_server_getAWSCreds(t *testing.T) {
	cpf := profile.NewClientProfile()
	cpf.HttpProfile.Endpoint = "sts.tencentcloudapi.com"
	client, _ := sts.NewClient(&common.Credential{}, "na-siliconvalley", cpf)
	timeoutInSeconds := int64(3600 * 1)
	req := sts.NewAssumeRoleWithSAMLRequest()
	req.RoleSessionName = common.StringPtr("test")
	req.DurationSeconds = common.Uint64Ptr(uint64(timeoutInSeconds))
	req.PrincipalArn = common.StringPtr("qcs::cam::uin/100021543443:saml-provider/Okta")
	req.RoleArn = common.StringPtr("qcs::cam::uin/100021543443:roleName/testOkta")
	req.SAMLAssertion = common.StringPtr("")
	resp, err := client.AssumeRoleWithSAMLWithContext(context.Background(), req)
	fmt.Println(resp.ToJsonString())
	fmt.Println(err)
}
